import Cell from "./Cell";
import Player from "./Player";
import {useState} from "react";
import MoveRoad from "./MoveRoad";

function Road({RoadContent})
{
    const [roadContent, setRoadContent] = useState(RoadContent);
    const [road, setRoad] = useState(roadContent.content);
    console.log(road);
    setTimeout(() => {
        setRoadContent(MoveRoad.MoveRoad(RoadContent));
        setRoad(roadContent.content)
        console.log(road)
    }, 1000)
    return [
        <p>{road}</p>,
        <table class="road">
            <tr>
                <Player></Player>
                <Cell code={road[0]}></Cell>
                <Cell code={road[1]}></Cell>
                <Cell code={road[2]}></Cell>
                <Cell code={road[3]}></Cell>
                <Cell code={road[4]}></Cell>
                <Cell code={road[5]}></Cell>
                <Cell code={road[6]}></Cell>
                <Cell code={road[7]}></Cell>
                <Cell code={road[8]}></Cell>
                <Cell code={road[9]}></Cell>
            </tr>
        </table>
    ]
}
export default Road
